ITV Tour De France 2012 Stage 18 Highlights PDTV x264 AAC

Presented by Gary Imlach, Chris Boardman and Ned Boulting. Commentary: Phil Liggett and Paul Sherwen. Stage 18 highlights, Blagnac to Brive-la-Gaillarde. The second-longest stage of the race which could see fireworks in the peloton with some tired legs a factor today. Nominally a flat stage, the itinerary includes four categorised climbs, the last of them, just 10km from the finish line. The right breakaway could cause havoc today.

